import React, { Component } from 'react';

class CreatePatient extends Component {
  constructor(props) {
    super();
    this.state = {

    }

  }

  HandleOnClick = (gender) => {
console.log(gender)
  }

  render() {
    return (
      <div className=" contentlayout content-wrapper " >

        <h2>Initialize patients</h2>
        <div className="col-md-4">
          <div className="form-group ">
            <label htmlFor="example1">First and last name</label>
            <input type="text" id="example1" className="form-control form-control-lg" />
          </div>
          <div className="form-group">
            <label htmlFor="example2">Citizen identification number</label>
            <input type="text" id="example2" className="form-control form-control-md" />
          </div>
          <div className="form-group">
            <label htmlFor="example3">Age</label>
            <input type="number" id="example3" className="form-control form-control-sm" min="1" max="100" />
          </div>
          <div className="form-group">
            <label htmlFor="example3">Gender</label>
            <br />
            <input type="radio" onClick={event => this.HandleOnClick(1)} name="gender" value="1" className="" /> Male<br />
            <input type="radio" onClick={event => this.HandleOnClick(0)} name="gender" value="0" className="" /> Female<br />
            <input type="radio"  onClick={event => this.HandleOnClick(2)} name="gender" value="2" /> Other <br />
          </div>
          <input type="submit" value="Submit" />

        </div>
      </div>
    )
  }
}

export default CreatePatient;
